import React, {Component} from 'react';


class UserManagement extends Component {
    componentDidMount(){
        this.users = fetch('/admin/users', {
            headers: {
             'Authorization': this.props.jwt,
            },
        });

        
    }

    render() {
        return <div>
            {this.users}
        </div>
    }
}


export default UserManagement;
